import React, { Component } from "react";
class NotFoundPage extends Component {
  render() {
    return (
      <div>
        <h2> Error 404.  This page does not exist</h2>
        <p>Select from the menu</p>
      </div>
    );
  }
} 
export default NotFoundPage;
